import { useState, useEffect } from "react";

function App() {
  const [todo, setTodo] = useState("");
  const onChange = (event) => setTodo(event.target.value);
  console.log(todo);

  return (
    <div>
      <form>
        <input
          onChange={onChange}
		  value={todo}
          type="text"
          placeholder="Write your to do..."
        ></input>
        <br />
        <button>Add To Do</button>
      </form>
    </div>
  );
}

export default App;
